import Link from "next/link";

const Navigation = () =>{
    return(
        <ul>
            <li>
                <Link href="/"><a>Home</a></Link>
            </li>
            <li>
                <Link href="/profile"><a>Profile</a></Link>
            </li>
            <li>
                <Link href="/register"><a>Register</a></Link>
            </li>
        </ul>
    )
}

export default Navigation;
